s the horizontal dimension of life, the surface layer of reality. Then there is the vertical dimension of depth, accessible to you only through the portal of the present moment.

So instead of adding time to yourself, remove time. The elimination of time from your consciousness is the elimination of ego. It is the only true spiritual practice‚Ä¶

